import './App.css';
import {Route, Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Route exact path='/' component={Home} />
      <Route exact path='/article' component={Article} />
      <Route exact path='/page3' component={Page3} />
      <Route exact path='/contact' component={Contact} />
    </div>
  );
}

export default App;
